import { useState } from "react";

async function GetDataJson(subject) {
  const response = await fetch(
    "https://www.googleapis.com/books/v1/volumes?q=subject:" + subject
  );

  return response.json();
}

// function Layout() {
//   return (
//     <>
//       <img src="./Nanami.png" alt="profile" width="200px" className="BorAnim" />
//     </>
//   );
// }

var some = 200;
var stylesss = `
    <style>
    .BorAnim {
        width: ${some} ;
        height: 200px;
      
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
      
        box-shadow: 0px 0px 15px rgb(47, 130, 255);
      }
    </style>
`;

function Layout() {
  return (
    <>
      <div
        dangerouslySetInnerHTML={{ __html: stylesss }}
        className="BorAnim"
      ></div>
    </>
  );
}

export default Layout;
